import React from 'react';

// function creating a Card function that has an image div

const Card = (props) => {
    return (
        <div className="card">
            <img src='https://robohash.org/pinkk' alt="robots" />
            <div>
                <h2>Jade Doe</h2>
                <p>Front End Developer</p>
            </div>
        </div>
    )
}

export default Card;
